public Range findDomainBounds(XYDataset dataset) {
    if (dataset == null) {
        return null;
    }
    Range r = DatasetUtilities.findDomainBounds(dataset, false);
    if (r == null) {
        return null;
    }
    double offset = 0; 
    return new Range(r.getLowerBound() + offset,
                     r.getUpperBound() + offset);
}

